import React from "react";
import { Link } from "react-router-dom";
const Menu = () => {
    return (
<>
<Link to="/about">About</Link>
<Link to="/Contact">Contact</Link>
<Link to="/Services">Services</Link>
</>
    );
};

export default Menu;
